-- Table structure for weixin_keywords
-- ----------------------------
DROP TABLE IF EXISTS `weixin_keywords`;
CREATE TABLE `weixin_keywords` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `key` varchar(30) NOT NULL,
  `keys` varchar(100) NOT NULL,
  `jf_type` int(11) NOT NULL,
  `jf_num` int(11) NOT NULL,
  `jf_maxnum` int(11) NOT NULL,
  `keyname` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='命令配置表';

-- ----------------------------
-- Records of weixin_keywords
-- ----------------------------

-- ----------------------------
-- Table structure for weixin_login
-- ----------------------------
DROP TABLE IF EXISTS `weixin_login`;
CREATE TABLE `weixin_login` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `createtime` int(11) NOT NULL,
  `uid` int(11) NOT NULL,
  `token` varchar(200) NOT NULL,
  `ip` varchar(15) NOT NULL,
  `value` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `value` (`value`),
  KEY `uid` (`uid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='扫描登陆表';

-- ----------------------------
-- Records of weixin_login
-- ----------------------------

-- ----------------------------
-- Table structure for weixin_menu
-- ----------------------------
DROP TABLE IF EXISTS `weixin_menu`;
CREATE TABLE `weixin_menu` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pid` int(11) NOT NULL,
  `name` varchar(32) NOT NULL,
  `type` tinyint(1) NOT NULL,
  `value` varchar(200) NOT NULL,
  `order` int(11) NOT NULL COMMENT '排序',
  PRIMARY KEY (`id`),
  KEY `pid` (`pid`)
) ENGINE=MyISAM AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COMMENT='自定义菜单表';

-- ----------------------------
-- Records of weixin_menu
-- ----------------------------

-- ----------------------------
-- Table structure for weixin_msg
-- ----------------------------
DROP TABLE IF EXISTS `weixin_msg`;
CREATE TABLE `weixin_msg` (
  `msgid` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL,
  `fake_id` varchar(32) NOT NULL,
  `content` text NOT NULL,
  `type` varchar(20) NOT NULL,
  `createtime` int(11) NOT NULL,
  `createymd` date NOT NULL,
  PRIMARY KEY (`msgid`),
  KEY `uid` (`uid`),
  KEY `createymd` (`createymd`),
  KEY `fake_id` (`fake_id`)
) ENGINE=MyISAM AUTO_INCREMENT=166 DEFAULT CHARSET=utf8 COMMENT='微信内容';

-- ----------------------------
-- Records of weixin_msg
-- ----------------------------

-- ----------------------------
-- Table structure for weixin_oauth
-- ----------------------------
DROP TABLE IF EXISTS `weixin_oauth`;
CREATE TABLE `weixin_oauth` (
  `oid` int(11) NOT NULL AUTO_INCREMENT,
  `weburl` varchar(200) NOT NULL,
  `click` int(11) NOT NULL,
  `id` int(11) NOT NULL COMMENT '分站ID',
  PRIMARY KEY (`oid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of weixin_oauth
-- ----------------------------

-- ----------------------------
-- Table structure for weixin_qcode
-- ----------------------------
DROP TABLE IF EXISTS `weixin_qcode`;
CREATE TABLE `weixin_qcode` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` tinyint(4) NOT NULL,
  `content` varchar(100) NOT NULL,
  `qcode` varchar(200) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='二维码表';

-- ----------------------------
-- Records of weixin_qcode
-- ----------------------------

-- ----------------------------
-- Table structure for weixin_sign
-- ----------------------------
DROP TABLE IF EXISTS `weixin_sign`;
CREATE TABLE `weixin_sign` (
  `sid` int(11) NOT NULL AUTO_INCREMENT,
  `wxid` int(11) NOT NULL,
  `signtime` int(11) NOT NULL,
  `signymd` date NOT NULL,
  PRIMARY KEY (`sid`),
  UNIQUE KEY `wxid` (`wxid`,`signymd`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='签到表';

-- ----------------------------
-- Records of weixin_sign
-- ----------------------------

-- ----------------------------
-- Table structure for weixin_signconf
-- ----------------------------
DROP TABLE IF EXISTS `weixin_signconf`;
CREATE TABLE `weixin_signconf` (
  `cid` int(11) NOT NULL AUTO_INCREMENT,
  `startymd` date NOT NULL,
  `endymd` date NOT NULL,
  `num` int(11) NOT NULL,
  `bignum` int(11) NOT NULL,
  `addnum` int(11) NOT NULL,
  PRIMARY KEY (`cid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='签到配置表';

-- ----------------------------
-- Records of weixin_signconf
-- ----------------------------

-- ----------------------------
-- Table structure for weixin_user
-- ----------------------------
DROP TABLE IF EXISTS `weixin_user`;
CREATE TABLE `weixin_user` (
  `uid` int(11) NOT NULL AUTO_INCREMENT,
  `ecuid` int(11) NOT NULL COMMENT '绑定用户ID',
  `fake_id` varchar(32) NOT NULL,
  `createtime` int(11) NOT NULL,
  `createymd` date NOT NULL,
  `isfollow` tinyint(1) NOT NULL,
  `nickname` varchar(32) NOT NULL,
  `sex` tinyint(1) NOT NULL,
  `headimgurl` varchar(200) NOT NULL,
  `country` varchar(20) NOT NULL,
  `province` varchar(20) NOT NULL,
  `city` varchar(20) NOT NULL,
  `access_token` varchar(40) NOT NULL COMMENT 'token',
  `expire_in` int(11) NOT NULL COMMENT 'token到期时间',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `fake_id` (`fake_id`),
  KEY `ecuid` (`ecuid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='微信用户表';

-- ----------------------------
-- Records of weixin_user
-- ----------------------------
